For our renderer we are using raycasts as in the first two papers listed. Initially, we went with the classic trapezoid approximation as used in Pathfinder, by casting two vertical and horizontal rays for each pixel to calculate intersection points. Using the separable convolution filter framework this would be calculated by using 1D box filter in x and y direction, but approximating quadratics. In comparison, the "GPU-Centered Font Rendering Directly from Glyph Outlines" paper (2nd in the list) uses two independent raycast (vertical & horizontal) with 1D box filtering with the option for supersampling by averaging the coverage values. It turned out that the trapezoid approach with raycasts on the GPU in our implementation suffered from floating point errors, so back to the drawing board! Motivated by the great work of @glowcoil in their gouache path renderer, who managed to achieve good anti aliasing even with only a single(!) ray, I looked more into this direction. Path Visualization Let's analyze the issue again in detail using the figure above. The red area denotes the coverage of the pixel for the red curve. We can either raycast vertically of horizontally from the sample point in the center of the pixel. In both cases the distance would be around 0. Using a simple 1D box filter would yield around 50% coverage which looks plausible fn box_filter(distance: f32) -> f32 { clamp(distance + 0.5, 0.0, 1.0)
} If we look at the pixel at left tho the story is totally different! A raycast in y-direction would yield reasonable results but in x-direction it would be around 0% as the distance would be over 0.5. To improve this we are incorporating the curve tangent on the ray intersection point, which gives an approximation of the trapezoid area coverage. See https://www.desmos.com/calculator/hg7j076glf for a plot of the where we can control the slope m. The green curve is the integral of the red curve which directly denotes the coverage area we are looking for. The figure Exact intergral shows the results when applying this approximation using the integral: fn intergral(d: f32, m: f32) -> f32 { let bound = -0.5 * m; let upper = clamp(d + 0.5, -bound, bound); let lower = clamp(d - 0.5, -bound, upper); let linear = clamp(lower - d + 0.5, 0.0, 1.0); let quadratic = 0.5 * (upper - lower + (upper * upper - lower * lower) / m); linear + quadratic
} 1D Box Filtering Our Integral approximation Exact integral Quality-wise the results are promising, from a computational aspect there is still room for improvement (: Looking at the integral curve in the plot, we can see its behavior when the slope converges to 0 and inf: Slope 0.3 Slope 3.0 For the m = inf case we see that the difference between the red and the green curve becomes negligible, so this would be a good approximation: We need to further tweak it to handle the m = 0 case by clamping the slope of our curve to not be smaller than 1. And with a bit of optimization we end up with our approximation: fn approx_aa(d: f32, tangent: f32x2) -> f32 { // Ignore signs as the problem is symmetric let tangent = abs(tangent); // `max` operation keeps the **inverse** slope <= 1 let inv_m = tangent.x / max(tangent.x, tangent.y); clamp(d * inv_m + 0.5, 0.0, 1.0)
}
